<strong>delete-duplicates</strong> is an alias for `<strong><a href="cl-delete-duplicates.html">cl-delete-duplicates</a></strong>' in `<code>cl.el</code>'.</br>
</br>
(delete-duplicates <u>SEQ</u> [<u>KEYWORD</u> <u>VALUE</u>]...)</br>
</br>
Remove all duplicate elements from <u>SEQ</u> (destructively).</br>
</br>
Keywords supported:  :test :test-not :key :start :end :from-end
